import Head from 'next/head';
import Navbar from './NavBar';

import { styled } from 'styled-components'
import reset from 'styled-reset'

const GlobalStyle = createGlobalStyle`
    ${reset}
`

const Body = styled.div`
    background-color: black;
`
const Layout = (props) => (
    <GlobalStyle>
        <Body>
            <Head>
                <title>SpaceX</title>
                <link href="https://fonts.googleapis.com/css2?family=Bebas+Neue&family=Poppins:wght@400;500;600;700;800;900&display=swap" rel="stylesheet"></link>
            </Head>
                <Navbar />
                {props.children}

        </Body>
    </GlobalStyle>
);

export default Layout;
